Challenge_03_Sender/Sender.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

/**
 * @title Sender PRO 2026
 * @notice Advanced smart contract to send ETH and ERC20 tokens.
 * @dev Includes batch sending, security features, events, pausing, withdraw, and owner control.
 */

interface IERC20 {
    function transfer(address to, uint256 amount) external returns (bool);
}

contract Sender {
    address public owner;
    bool public paused;

    event EthSent(address indexed to, uint256 amount);
    event TokenSent(address indexed token, address indexed to, uint256 amount);
    event BatchEthSent(uint256 count);
    event BatchTokenSent(address indexed token, uint256 count);
    event Withdraw(address indexed owner, uint256 amount);
    event Paused(bool status);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    modifier notPaused() {
        require(!paused, "Sender is paused");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    // ---------------------------------------------------------
    // üõë OWNER CONTROL
    // ---------------------------------------------------------
    function setPaused(bool _paused) external onlyOwner {
        paused = _paused;
        emit Paused(_paused);
    }

    // ---------------------------------------------------------
    // üí∏ SEND ETH
    // ---------------------------------------------------------
    function sendETH(address payable _to) external payable notPaused {
        require(_to != address(0), "Invalid address");
        require(msg.value > 0, "Amount must be greater than 0");

        (bool success, ) = _to.call{value: msg.value}("");
        require(success, "ETH transfer failed");

        emit EthSent(_to, msg.value);
    }

    // ---------------------------------------------------------
    // üí∏ BATCH SEND ETH
    // ---------------------------------------------------------
    function batchSendETH(
        address payable[] calldata _recipients,
        uint256[] calldata _amounts
    ) external payable notPaused {
        require(_recipients.length == _amounts.length, "Length mismatch");

        uint256 total = 0;
        for (uint256 i = 0; i < _amounts.length; i++) {
            total += _amounts[i];
        }
        require(msg.value == total, "Incorrect ETH amount");

        for (uint256 i = 0; i < _recipients.length; i++) {
            (bool success, ) = _recipients[i].call{value: _amounts[i]}("");
            require(success, "ETH batch transfer failed");
        }

        emit BatchEthSent(_recipients.length);
    }

    // ---------------------------------------------------------
    // ü™ô SEND TOKENS
    // ---------------------------------------------------------
    function sendToken(
        address token,
        address to,
        uint256 amount
    ) external notPaused onlyOwner {
        require(to != address(0), "Invalid address");

        require(IERC20(token).transfer(to, amount), "Token transfer failed");

        emit TokenSent(token, to, amount);
    }

    // ---------------------------------------------------------
    // ü™ô BATCH SEND TOKENS
    // ---------------------------------------------------------
    function batchSendToken(
        address token,
        address[] calldata recipients,
        uint256[] calldata amounts
    ) external notPaused onlyOwner {
        require(recipients.length == amounts.length, "Length mismatch");

        for (uint256 i = 0; i < recipients.length; i++) {
            require(
                IERC20(token).transfer(recipients[i], amounts[i]),
                "Batch token transfer failed"
            );
        }

        emit BatchTokenSent(token, recipients.length);
    }

    // ---------------------------------------------------------
    // üè¶ WITHDRAW ETH FROM CONTRACT
    // ---------------------------------------------------------
    function withdraw(uint256 amount) external onlyOwner {
        require(address(this).balance >= amount, "Insufficient balance");

        (bool success, ) = payable(owner).call{value: amount}("");
        require(success, "Withdraw failed");

        emit Withdraw(owner, amount);
    }

    // ---------------------------------------------------------
    // üîç VIEW CONTRACT BALANCE
    // ---------------------------------------------------------
    function contractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    // Allow the contract to receive ETH
    receive() external payable {}
}

